INSERT INTO `contact` (`cid`, `category`, `recipients`, `reply`, `weight`, `selected`) VALUES
(1, 'Personal Inquiry website help form', 'm.b.gaved@open.ac.uk,p.mulholland@open.ac.uk,t.d.collins@open.ac.uk', 'Sustainability Squad help form\r\n---------------------------------------\r\n\r\nThank you for getting in contact with us. We''ll get in contact shortly. \r\n\r\nIf you''re having problems logging into the Sustainability Squad Activity Guide, don''t forget we gave you a help sheet with your mini-laptop. We will be happy to give you a replacement in the next after school club session. Remember to bring your laptop along with you and one of the Open University staff will be able to help you.\r\n\r\nKind regards\r\nThe Open University Sustainability Squad team.\r\n\r\n', 0, 0);
