(307, 307, 1, 'Sustainability Squad Survey', '<img style=''float: right;'' width=''50%'' src=''files/sustainability-venn-diagram.png'' />\r\n\r\n<h3>What is sustainability</h3>\r\n \r\n<p>Sustainability is an economic state where the demands placed upon the environment by people and commerce can be met without reducing the capacity of the environment to provide for future generations. It can also be expressed in the simple terms of an economic golden rule for the restorative economy: leave the world better than you found it, take no more than you need, try not to harm life of the environment, make amends if you do.</p>\r\n\r\n<p><i>Information taken from:</i> http://www.googolpower.com/content/free-learning-resources/environmental-education/definitions-of-sustainability-for-children/</p>\r\n\r\n<h3>\r\n<!--break-->\r\nFood sustainability: Main Issues</h3>\r\n\r\n<p>Learning about sustainable food and the problems with factory farming can be daunting at first, but, with a little effort, you can quickly learn enough to make the safest and wisest food choices for you and your family.</p>\r\n\r\n<p>In this section, we introduce you to the major issues surrounding sustainable meat and factory farming. If it seems overwhelming, simply switch to sustainable and you won''t have to worry about the problems surrounding our meat supply!</p>\r\n\r\n<p><b>Additives</b> Much of the food we find at today''s supermarkets is highly processed and contains numerous food additives. These substances are used to change the way food tastes and looks (altering the colour and texture), to improve the nutritional quality of foods (adding vitamins and minerals), and to increase the food''s shelf life to prevent spoilage.</p>\r\n\r\n<p><b>Air Pollution</b> Industrial farms produce massive amounts of animal waste that is known to release greenhouse gasses into the air. Aside from the air pollution that comes from farm waste, the industrialised food system also burns significant amounts of fossil fuels to power the trucks that distribute products.</p>\r\n\r\n<p><b>Animal Welfare</b> As farms have become more industrialised, animals have become more of a commodity. They are considered units of production, rather than living, breathing beings, and as a result these animals are treated inhumanely. But increasingly, more and more consumers are demanding better treatment of animals.</p>\r\n\r\n<p><b>Antibiotics</b> Because of the crowded and unsanitary conditions on factory farms, animals are often fed low doses of antibiotics. Antibiotics are also used to make the animals grow faster. This is contributing to the growing problem of antibiotic-resistant bacteria in humans.</p>\r\n\r\n<p><b>Climate Change</b> So how is food-supposedly life-sustaining stuff-one of the key factors in an environmental crisis that threatens the basis of life on earth? A big part of the answer is in the rapid and radical twentieth-century transformation of our food system from sustainably based, locally focused production, to a fossil-fuel addicted industrialized system.</p>\r\n\r\n<p><b>Communities</b> Sustainable farms provide a welcome alternative to the problems associated with factory farming. Unlike corporate factory farm owners who have very little interest in the condition of local communities, sustainable farmers have a strong connection to their communities and a demonstrated commitment to preserving the surrounding land. In addition, workers on sustainable farms are treated fairly and earn a respectable wage.</p>\r\n\r\n<p><b>Dairy</b> Dairy foods production is a multi-billion dollar industry, and over the past century it has grown increasingly concentrated in the hands of a few major corporations. This has lead to widespread environmental damage, low standards of animal welfare, and mass production of milk tainted with antibiotics, artificial growth hormones and pesticide residues.</p>\r\n\r\n<p><b>Eat Local, Buy Local, Be Local</b> Most meals travel hundreds or even thousands of miles to reach your dinner plate. By eating food produced locally, you are helping yourself, the environment and your community.</p>\r\n\r\n<p><b>Economics</b> Proponents of industrial agriculture claim that large-scale factory farming is the most efficient way to produce huge quantities of inexpensive food and that without industrial agriculture, food prices would be excessively high. But the price of industrial food does not take into account the true costs of production. When these hidden environmental and health costs are factored in, industrial food costs more than sustainable.</p>\r\n\r\n<p><b>Environment</b> Agriculture has an enormous impact on the environment, but whether the impact is good or bad depends on the type of agriculture used. Sustainable agriculture puts back what it takes from the environment, while factory farming pollutes our air, water and soil.</p>\r\n\r\n<p><b>Factory Farming</b> Meat and dairy production in the United States has changed dramatically over the past 30 years. Small family farms have been replaced by huge livestock facilities, where animals suffer horribly, workers are mistreated, the environment is being destroyed, and where rural communities are falling apart.</p>\r\n\r\n<p><b>Family Farms</b> Family farmers are being forced out of business at an alarming rate, and hundreds of small farmers sell their land every week. The dramatic expansion of industrial agriculture has made it increasingly difficult for small family farmers in the US, but many small family farms have found hope within the sustainable food movement.</p>\r\n\r\n<p><b>Feed</b> Animals on industrial farms are fed the cheapest grains and waste products in order to fatten them quickly. This leads to widespread health problems, so low doses of antibiotics are also added to the feed. The result is unhealthy animals and unhealthy food for consumers.</p>\r\n\r\n<p><b>Food Irradiation</b> Irradiation is used to increase the shelf life of the food so it can travel longer distances and keep for as long as possible. This processing method has not been properly tested for safety and it depletes the vitamin content of food.</p>\r\n\r\n<p><b>Food Safety</b> The significant corporate consolidation of global food production has created a food system that values quantity over quality. Every single decision a farmer, or corporation, makes about growing or raising a certain kind of food affects the final product. Cutting corners on the quality of animal feed, waste management, level of training for farm workers, processing methods and distribution all contribute to the safety of our food.</p>\r\n\r\n<p><b>Fossil Fuel and Energy Use</b> Industrial agriculture relies on machinery to produce food and trucks to transport the food throughout the country, and likewise consumes massive amounts of fuel and energy. Sustainable farms work to minimize their energy use, and since their products are bought locally, minimal fuel is burned in order to transport their goods.</p>\r\n\r\n<p><b>Health</b> Sustainable foods are healthier than industrial food because of higher levels of "good" fats and nutrients in grass-fed animal products and lower pesticide residues in organic foods. Meanwhile, industrially-produced food is detrimental to our health because it leads to outbreaks of foodborne illness, contributes to antibiotic resistance, and pollutes drinking water.</p>\r\n\r\n<p><b>Hormones</b> Artificial hormones are implanted in beef and dairy cattle to make them grow faster and produce more milk. The US government claims the hormones are safe, but the European Union has banned hormones because of a possible link between hormones and some types of cancer.</p>\r\n\r\n<p><b>Organic</b> Organic farmers must follow specific guidelines in order to label their foods "organic." For example, animals cannot be given antibiotics or hormones, chemical pesticides cannot be used, and meat cannot be irradiated.</p>\r\n\r\n<p><b>Pasture Raised</b> Pasture-raised animals spend most of their time outdoors, where they''re able to eat nutritious grasses and other plants as they would in nature. In addition to dramatically improving the welfare of farm animals, pasturing helps reduce environmental damage, and yields meats, eggs, and dairy products which are tastier and more nutritious than foods produced on industrial farms.</p>\r\n\r\n<p><b>Pesticides</b> Pesticides are sprayed on crops that are fed to farm animals. Residues are stored in the animals'' fat and tissue, and enter our bodies when we eat the meat. Pesticides have been linked to many medical problems.</p>\r\n\r\n<p><b>Slaughterhouses and Processing</b> The US meatpacking industry is dominated by a handful of corporations that process massive quantities of meat in huge plants. As a result of inadequate food safety standards and lax inspection practices by the USDA, these corporations are able to operate unsanitary facilities and send out meat contaminated with dangerous bacteria. These facilities are also extremely dangerous, and meat-packing is among the most hazardous jobs in the nation.</p>\r\n\r\n<p><b>Waste</b> Some industrial livestock facilities produce as much sewage as a small city, but they are not required to treat all this waste. Instead, the waste is held in large pools and spread on farm fields where it often runs off into nearby water systems.</p>\r\n\r\n<p><b>Workers</b> Workers on industrial farms and in meat processing facilities work in hazardous conditions, and are underpaid and mistreated.\r\n\r\n<p><i>Information taken from:</i> http://www.sustainabletable.org/issues/</p>', '<img style=''float: right;'' width=''50%'' src=''files/sustainability-venn-diagram.png'' />\r\n\r\n<h3>What is sustainability</h3>\r\n \r\n<p>Sustainability is an economic state where the demands placed upon the environment by people and commerce can be met without reducing the capacity of the environment to provide for future generations. It can also be expressed in the simple terms of an economic golden rule for the restorative economy: leave the world better than you found it, take no more than you need, try not to harm life of the environment, make amends if you do.</p>\r\n\r\n<p><i>Information taken from:</i> http://www.googolpower.com/content/free-learning-resources/environmental-education/definitions-of-sustainability-for-children/</p>\r\n\r\n<h3>\r\n', '', 1253621313, 2),
