(732, 783, 81, 'Location', 'The microclimates investigation will be based around taking observations in different places around the campus. Location is a key measure for this investigation. You will use local signs to accurately identify your position at each location.', 'The microclimates investigation will be based around taking observations in different places around the campus. Location is a key measure for this investigation. You will use local signs to accurately identify your position at each location.', '', 1276688565, 0),
(733, 784, 81, 'Temperature', 'Temperature is an important measure for understanding weather and climate. Taking temperature readings will help you understand whether there are different microclimates around the school''s grounds.', 'Temperature is an important measure for understanding weather and climate. Taking temperature readings will help you understand whether there are different microclimates around the school''s grounds.', '', 1276620890, 0),
(734, 785, 81, 'Humidity', 'Relative humidity measures what amount of water vapour there is in the air. Relative humidity is measured as a percentage, from 0 to 100%. A humidity sensor attached to a data logger is used to measure relative humidity for the microclimates investigation.', 'Relative humidity measures what amount of water vapour there is in the air. Relative humidity is measured as a percentage, from 0 to 100%. A humidity sensor attached to a data logger is used to measure relative humidity for the microclimates investigation.', '', 1276620908, 0),
(735, 786, 81, 'Windspeed', 'The speed of the wind will provide a lot of information about the local microclimate of a location. Wind speed is measured in rotational velocity using an anemometer.', 'The speed of the wind will provide a lot of information about the local microclimate of a location. Wind speed is measured in rotational velocity using an anemometer.', '', 1276620898, 0),
(736, 787, 81, 'Notes', 'It is important to take notes at each location to support the readings you take using the scientific instruments. Make sure you describe any interesting features such as the location of buildings, general weather conditions, whether the area is in sunlight or shade, etc.', 'It is important to take notes at each location to support the readings you take using the scientific instruments. Make sure you describe any interesting features such as the location of buildings, general weather conditions, whether the area is in sunlight or shade, etc.', '', 1276620916, 0),
