(841, 900, 1, 'Preparation', 'Your inquiry is organised into things that you need to do at certain times. A period of time is called a ''stage''. This stage is called ''Preparation''. Have a look and see what you need to do by clicking on the activities below. Some you can do right now, others you will be able to do later on.', 'Your inquiry is organised into things that you need to do at certain times. A period of time is called a ''stage''. This stage is called ''Preparation''. Have a look and see what you need to do by clicking on the activities below. Some you can do right now, others you will be able to do later on.', '', 1273835849, 1),
