(853, 912, 1, 'Healthy Eating', 'An investigation of how healthy we eat.', 'An investigation of how healthy we eat.', '', 1272635955, 1),
(854, 913, 1, 'Find my topic', '<p>Every inquiry needs to have a focus. To find your focus you will need to choose a domain and a topic.  A domain is often set by your teacher and the curriculum, for example, healthy living.\r\n</p><p>\r\nDuring this phase you can read about what is known by scientists. You need to decide on what you will be focusing on.\r\n</p>', '<p>Every inquiry needs to have a focus. To find your focus you will need to choose a domain and a topic.  A domain is often set by your teacher and the curriculum, for example, healthy living.\r\n</p><p>\r\nDuring this phase you can read about what is known by scientists. You need to decide on what you will be focusing on.\r\n</p>', '', 1274444995, 1),
(855, 914, 1, 'Decide my inquiry question or hypothesis', 'You need to specify a question that summarises what you want to find out in your inquiry. It needs to be specific and measurable.\r\n<p>Then you can make a prediction.</p>', 'You need to specify a question that summarises what you want to find out in your inquiry. \r\nIt needs to be specific and measurable.\r\n<p>Then you can make a prediction.</p>', '', 1274444995, 1),
(856, 915, 1, 'Plan my methods, equipment & actions', 'We decided to focus on two methods: </br>\r\n<ul>\r\n<li>Interview</li>\r\n<li>Diary</li>\r\n</ul>\r\nClick below to read a quick description of each method and make a plan of how to carry it out.', 'We decided to focus on two methods: </br>\r\n<ul>\r\n<li>Interview</li>\r\n<li>Diary</li>\r\n</ul>\r\nClick below to read a quick description of each method and make a plan of how to carry it out.', '', 1274444995, 1),
(857, 916, 1, 'Collect my evidence', '<p>You can collect your evidence using the methods you have chosen. You might be using specific tools to collect evidence, i.e. cameras, questionnaires, simulations, which have been specified from the planning phase.\r\n</p>\r\n<p> \r\nYou will need to \r\n<ul>\r\n<li>keep records of their data,</li>\r\n<li>collect data that is reliable,</li> \r\n<li>deal with probable noise in data,</li>\r\n<li>accept or reject data,</li>\r\n<li>identify errors in data in situ,</li>\r\n<li>make sure you collect a full set of data</li>\r\n</ul>\r\n', '<p>You can collect your evidence using the methods you have chosen. You might be using specific tools to collect evidence, i.e. cameras, questionnaires, simulations, which have been specified from the planning phase.\r\n</p>\r\n<p> \r\nYou will need to \r\n<ul>\r\n<li>keep records of their data,</li>\r\n<li>collect data that is reliable,</li> \r\n<li>deal with probable noise in data,</li>\r\n<li>accept or reject data,</li>\r\n<li>identify errors in data in situ,</li>\r\n<li>make sure you collect a full set of data</li>\r\n</ul>\r\n', '', 1274444995, 1),
(858, 917, 1, 'Analyse and represent my evidence', '<p>During the data analysis, you need to see your data and transform it in order to make sense of it, e.g. through different graphs, charts, etc to help you understand relationships in data and see trends and patterns.  \r\n</p><p>\r\nDuring this phase, you may find errors in data and so think why they occurred.</p>', '<p>During the data analysis, you need to see your data and transform it in order to make sense of it, e.g. through different graphs, charts, etc to help you understand relationships in data and see trends and patterns.  \r\n</p><p>\r\nDuring this phase, you may find errors in data and so think why they occurred.</p>', '', 1274444995, 1),
(859, 918, 1, 'Respond to my question or hypothesis', 'You can write your findings and your answer to the inquiry questions.', 'You can write your findings and your answer to the inquiry questions.', '', 1274444995, 1),
(860, 919, 1, 'Share and discuss my inquiry', 'Let other people know what you did and what you found out. Ask them their opinion and discuss your ideas.\r\n', 'Let other people know what you did and what you found out. Ask them their opinion and discuss your ideas.\r\n', '', 1274444995, 1),
(861, 920, 1, 'Reflect on my progress', '<p>You can write what you think of this investigation. </p><p>Do you find the results representative of your livestyle? What would you do differently if you could repeat this investigation?\r\n</p><p>\r\nWould you make changes to your lifestyle because of this investigation?\r\n</p>', '<p>You can write what you think of this investigation.</p><p> Do you find the results representative of your livestyle? What would you do differently if you could repeat this investigation?\r\n</p><p>\r\nWould you make changes to your lifestyle because of this investigation?\r\n</p>', '', 1274444995, 1),
