(271, 1207, 1, 'What is nQuire?', 'nQuire is a toolkit for inquiry science learning. It can run on a range\r\nof devices including netbooks, laptops, and smartphones.\r\n\r\n<p>This web-based version of nQuire allows you to see and try demonstration\r\nversions of the software. </p>\r\n\r\n<p>So, log in and find out more.</p>\r\n\r\n<p>If you are carrying out an investigation and you have been given a login\r\nand a password, click on the link in left hand menu bar to go to your\r\ninvestigations. </p>\r\n\r\n<p>If you''re a visitor and you are interested in finding out more about the\r\nnQuire tool and the Personal Inquiry project, click here.</p>\r\n<!--break-->\r\n', 'nQuire is a toolkit for inquiry science learning. It can run on a range\r\nof devices including netbooks, laptops, and smartphones.\r\n\r\n<p>This web-based version of nQuire allows you to see and try demonstration\r\nversions of the software. </p>\r\n\r\n<p>So, log in and find out more.</p>\r\n\r\n<p>If you are carrying out an investigation and you have been given a login\r\nand a password, click on the link in left hand menu bar to go to your\r\ninvestigations. </p>\r\n\r\n<p>If you''re a visitor and you are interested in finding out more about the\r\nnQuire tool and the Personal Inquiry project, click here.</p>\r\n', '', 1276166820, 2),
(271, 1208, 1, 'What is nQuire?', 'nQuire is a toolkit for inquiry science learning. It can run on a range\r\nof devices including netbooks, laptops, and smartphones.\r\n\r\n<p>This web-based version of nQuire allows you to see and try demonstration\r\nversions of the software. </p>\r\n\r\n<p>So, log in and find out more.</p>\r\n\r\n<p>If you are carrying out an investigation and you have been given a login\r\nand a password, click on the link in left hand menu bar to go to your\r\ninvestigations. </p>\r\n\r\n<p>If you''re a visitor and you are interested in finding out more about the\r\nnQuire tool and the Personal Inquiry project, <a href=''http://www.pi-project.ac.uk''>click here</a>.</p>\r\n<!--break-->\r\n', 'nQuire is a toolkit for inquiry science learning. It can run on a range\r\nof devices including netbooks, laptops, and smartphones.\r\n\r\n<p>This web-based version of nQuire allows you to see and try demonstration\r\nversions of the software. </p>\r\n\r\n<p>So, log in and find out more.</p>\r\n\r\n<p>If you are carrying out an investigation and you have been given a login\r\nand a password, click on the link in left hand menu bar to go to your\r\ninvestigations. </p>\r\n\r\n<p>If you''re a visitor and you are interested in finding out more about the\r\nnQuire tool and the Personal Inquiry project, <a href=''http://www.pi-project.ac.uk''>click here</a>.</p>\r\n', '', 1276166890, 2),
