INSERT INTO `pi_wiki_notes` (`nid`, `vid`, `notes`) VALUES
(514, 515, 'it will be stored at home'),
(515, 516, 'we will eat it to test which one taste the best and which one is the most salty'),
(517, 518, 'Sam and Gemma will be storing the steaks at their homes - Gemma will have the ones from Tesco and Sam will have the steaks from an alternative store - probably Sainsburies. - Sam'),
(519, 520, 'Sam would do this, but would be too biased. This will be Gemma''s job. \r\n\r\nHow old are the cows when they are killed?\r\nHow are they killed? Is it humane? '),
(520, 521, 'Dania will research how the cow is reared - Sam\r\n\r\nYes, I will - Dania\r\n\r\nWhat is the cow fed?\r\nHow much space does it have?\r\nDoes it get let outside? How much? For how long every day?\r\nFree range or kept in a cage?'),
(521, 522, 'Sophie will be researching the waste.\r\n\r\nHow do people dispose of left over meat?\r\nHow much good food is thrown away?\r\nWhat is the best way to dispose of left over me?\r\nIs it safe to put steak down a food disposal pipe?\r\n'),
(522, 523, 'Dania and Sophie will do packaging\r\n\r\nWhat kind of packaging is used?\r\nIs it airtight?\r\nBefore being packaged, does meat get cross contaminated?'),
(523, 524, 'Sophia is going to get information on the care of baby animals and their mothers. \r\n \r\nHow are the animals kept, and in which conditions? \r\nWhat are they fed?\r\nAt what age are the baby cows taken from their mothers?'),
(524, 525, 'there will be one organic burger and a tesco burger'),
(527, 528, 'We will check and record the places where they were planted and grown and if the places that they are from are far away, we will research the air miles used to transport them over to the supermarkets.  We will also research the standards and procedures of the farms and land they are from, fertilizers used, etc.'),
(528, 529, 'both burgers should be packaged in plastic'),
(529, 530, 'it is born'),
(521, 532, 'How do people dispose of left over meat?\r\nHow much good food is thrown away? \r\nWhat is the best way to dispose of left over meat?\r\nIs it safe to put steak down a food disposal pipe?\r\n\r\nThe British throw away about 30-40% of our food. A recent survey found that 61% of people throw away at least one bag of salad a week without even taking off the packaging. Luckily for our investigation, slightly fewer admitted to throwing away meat. \r\n\r\nIf meat is cooked, it can be disposed of in a waste disposal unit. Waste disposal units have been in America for many years and they''re now becoming part of some European kitchens. Usually they are fitted under the kitchen sink and catch solid waste before it gets into the drain. When it''s switched on, the waste disposal unit grinds down food waste into a runny pulp which then washes down the drain without blocking it. As it is soft, cooked meat will pass through easily and safely as long as the water is running. However, uncooked meat can be tough enough to wrap itself around the inside of the waste disposal unit and when it''s stuck it will start to decompose and your kitchen will start to smell!'),
(535, 539, 'Bread flour is grown not reared\r\nNo ingredients in bread have reared as they have been grown into crops to harvest.\r\n'),
(536, 540, 'All the ingredients of bread have been harvested crops which have then been changed into the differnt ingredients of white or brown bread.'),
(537, 541, 'the flour used in flour is normally planted because it is made from a plant. the plant is then grounded up. White flour is used from white bread, hence the name, and brown is made from brown flour. All the ingredients int eh bread have been planted because it is not made from anything liek cows or other animals.'),
(539, 543, 'The bread you typically find in supermarkets is usually covered in plastic which is not generally recyclable, meaning that all the packaging used in protecting the bread will then be thrown onto a landfill site. When I buy bread from the bakery it usually comes in a paper bag which gives me the option to use it again or recycle it.'),
(540, 545, 'White bread is processed more than brown bread because it has more chemicals in. Brown bread is completely made of natural ingredients there fore it doesnt need to be processed as much. The process for bread does not really make an impact on if the bread lasts longer because there is nothing except the chemicals that could make a difference to our results.'),
(542, 547, 'Bread found in supermarkets have started in  one bread farm and then through lorries (which pollute the environment) are then transported thoughout the country to differnt chains of supermarket. In some bakerys you can find bread made freshly that day which has only been transported from the kitchen to where it would be sold. '),
(522, 548, 'What kind of packaging is used?\r\nIs it airtight?\r\nBefore being packaged, does meat get cross contaminated?\r\n\r\nA butcher can sell meat in different ways. One of these is vacuum-packing. Vacuum packing seals in cuts of meat in plastic bags that air has been taken out of. It is also really hygienic because the packs are leakproof and clean. However, some butchers don''t like vacuum packing their meat because people claim there is a ''sour'' taste to it when they do.\r\n\r\nMeat can also be packaged using ''overwrapping''. Before modified atmosphere packaging and centralised pre-packing, overwrapping was used mainly for selling meat in shops. \r\n\r\nModified atmosphere packaging is when meat is packed under modified atmospheres- these contain higher levels of oxygen and carbon dioxide.\r\n\r\n'),
(543, 549, 'The bread that is stored in a bread bin is likely to last the longest because it is not open to any moisture or bacteria. In resturants it is supposed to be inspected daily so if there is an sign of mould then it is disposed of immediatly. There is a danger of mould if it is a low rated cafe because they dont have the money to get new bread every day so sometimes they may serve 3 or 4 day old bread. At home you are more aware and worried of moulding so you check more often.'),
(544, 550, 'Bananas are grown on banana trees'),
(545, 551, 'White bread is the typical choice for a young family because it is cheap and lasts longer. Children usually prefer the look of white bread to brown bread as sometimes brown bread could have seeds in or bits. Brown bread also dosent last as long as white bread as it is a purer bread.'),
(546, 552, 'the food that you buy in the supermarket has plastic packaging round it so that it is kept fresh. The fod that is brtought from a baker is fresh so there is no ned as long as you buy and eat it on the same day.'),
(521, 553, 'How do people dispose of left over meat?\r\nHow much good food is thrown away? \r\nWhat is the best way to dispose of left over meat?\r\nIs it safe to put steak down a food disposal pipe?\r\n\r\nThe British throw away about 30-40% of our food. A recent survey found that 61% of people throw away at least one bag of salad a week without even taking off the packaging. Luckily for our investigation, slightly fewer admitted to throwing away meat. \r\n\r\nIf meat is cooked, it can be disposed of in a waste disposal unit. Waste disposal units have been in America for many years and they''re now becoming part of some European kitchens. Usually they are fitted under the kitchen sink and catch solid waste before it gets into the drain. When it''s switched on, the waste disposal unit grinds down food waste into a runny pulp which then washes down the drain without blocking it. As it is soft, cooked meat will pass through easily and safely as long as the water is running. However, uncooked meat can be tough enough to wrap itself around the inside of the waste disposal unit and when it''s stuck it will start to decompose and your kitchen will start to smell!'),
(527, 554, 'Banana trees are grown in very hot countries. So therefore they are planted.'),
(522, 555, 'What kind of packaging is used?\r\nIs it airtight?\r\nBefore being packaged, does meat get cross contaminated?\r\n\r\nA butcher can sell meat in different ways. One of these is vacuum-packing. Vacuum packing seals in cuts of meat in plastic bags that air has been taken out of. It is also really hygienic because the packs are leakproof and clean. However, some butchers don''t like vacuum packing their meat because people claim there is a ''sour'' taste to it when they do.\r\n\r\nMeat can also be packaged using ''overwrapping''. Before modified atmosphere packaging and centralised pre-packing, overwrapping was used mainly for selling meat in shops. \r\n\r\nModified atmosphere packaging is when meat is packed under modified atmospheres- these contain higher levels of oxygen and carbon dioxide. \r\n-Sophie\r\n\r\n'),
(521, 556, 'How do people dispose of left over meat?\r\nHow much good food is thrown away? \r\nWhat is the best way to dispose of left over meat?\r\nIs it safe to put steak down a food disposal pipe?\r\n\r\nThe British throw away about 30-40% of our food. A recent survey found that 61% of people throw away at least one bag of salad a week without even taking off the packaging. Luckily for our investigation, slightly fewer admitted to throwing away meat. \r\n\r\nIf meat is cooked, it can be disposed of in a waste disposal unit. Waste disposal units have been in America for many years and they''re now becoming part of some European kitchens. Usually they are fitted under the kitchen sink and catch solid waste before it gets into the drain. When it''s switched on, the waste disposal unit grinds down food waste into a runny pulp which then washes down the drain without blocking it. As it is soft, cooked meat will pass through easily and safely as long as the water is running. However, uncooked meat can be tough enough to wrap itself around the inside of the waste disposal unit and when it''s stuck it will start to decompose and your kitchen will start to smell! -Sophie'),
(547, 557, 'Bananas get stored at both home and resteraunts. They are mainley kept in dry places, that have a fairly high temperature.'),
(548, 558, 'bananas are very yummy 2 eat!!!!!!!! this is all we hav found out about eating bananas'),
(548, 560, 'bananas are eaten all over the worls some people think they are yummy and nice to play with but others think they are mankey\r\n!!!!!!!!!'),
(550, 565, 'bananas are packages in different ways depending of their quality - we think that the value bananas will have worse quality packaging than the finest quality packaging bacause of the prices. '),
(551, 566, 'The best season to buy fruit and vegetables is in Summer, in: July, June and August. The fruit  and vegetables that you can buy in these months are: Aubergine\r\nBeetroot\r\nBroad Beans\r\nBroccoli\r\nCarrots\r\nCourgettes \r\nCucumber\r\nFennel\r\nFresh Peas\r\nGarlic\r\nGreen Beans\r\nLettuce and Salad Leaves\r\nNew potatoes\r\nRadishes\r\nRocket\r\nRunner Beans\r\nSalad Onions\r\nSorrel\r\nTomatoes\r\nWatercress\r\nBlueberries\r\nCurrants – black, white and red\r\nElderflowers\r\nGreengages\r\nLoganberries\r\nPlums\r\nRaspberries\r\nStrawberries\r\nTayberries\r\n'),
(552, 567, 'Banana are harvested.'),
(544, 568, 'Bananas are grown on banana trees. They are grown in small clusters of up to 20 fruit to a tier. They are grown in around 107 countries.'),
(522, 570, 'What kind of packaging is used?\r\nIs it airtight?\r\nBefore being packaged, does meat get cross contaminated?\r\n\r\nA butcher can sell meat in different ways. One of these is vacuum-packing. Vacuum packing seals in cuts of meat in plastic bags that air has been taken out of. It is also really hygienic because the packs are leakproof and clean. However, some butchers don''t like vacuum packing their meat because people claim there is a ''sour'' taste to it when they do.\r\n\r\nMeat can also be packaged using ''overwrapping''. Before modified atmosphere packaging and centralised pre-packing, overwrapping was used mainly for selling meat in shops. \r\n\r\nModified atmosphere packaging is when meat is packed under modified atmospheres- these contain higher levels of oxygen and carbon dioxide. \r\n-Sophie\r\n\r\n'),
(521, 571, 'How do people dispose of left over meat?\r\nHow much good food is thrown away? \r\nWhat is the best way to dispose of left over meat?\r\nIs it safe to put steak down a food disposal pipe?\r\n\r\nThe British throw away about 30-40% of our food. A recent survey found that 61% of people throw away at least one bag of salad a week without even taking off the packaging. Luckily for our investigation, slightly fewer admitted to throwing away meat. -Sophie\r\n\r\nIf meat is cooked, it can be disposed of in a waste disposal unit. Waste disposal units have been in America for many years and they''re now becoming part of some European kitchens. Usually they are fitted under the kitchen sink and catch solid waste before it gets into the drain. When it''s switched on, the waste disposal unit grinds down food waste into a runny pulp which then washes down the drain without blocking it. As it is soft, cooked meat will pass through easily and safely as long as the water is running. However, uncooked meat can be tough enough to wrap itself around the inside of the waste disposal unit and when it''s stuck it will start to decompose and your kitchen will start to smell! -Sophie'),
(548, 572, 'bananas are eaten all over the world'),
(522, 573, 'What kind of packaging is used?\r\nIs it airtight?\r\nBefore being packaged, does meat get cross contaminated?\r\n\r\nA butcher can sell meat in different ways. One of these is vacuum-packing. Vacuum packing seals in cuts of meat in plastic bags that air has been taken out of. It is also really hygienic because the packs are leakproof and clean. However, some butchers don''t like vacuum packing their meat because people claim there is a ''sour'' taste to it when they do. -Sophie\r\n\r\nMeat can also be packaged using ''overwrapping''. Before modified atmosphere packaging and centralised pre-packing, overwrapping was used mainly for selling meat in shops. -Sophie\r\n\r\nModified atmosphere packaging is when meat is packed under modified atmospheres- these contain higher levels of oxygen and carbon dioxide. \r\n-Sophie\r\n\r\n'),
(548, 574, 'bananas are eaten all over the world and even by monkeys!!!!!!!!'),
(548, 575, 'bananas are eaten all over the world and even by monkeys!!!!!!!! e.g. sophie p'),
(548, 576, 'bananas are eaten all over the world and even by monkeys!!!!!!!! e.g. sophie p'),
(548, 577, 'bananas are eaten all over the world by people!!!!!!!!!'),
(544, 578, 'Bananas are grown on banana trees. They are grown in small clusters of up to 20 fruit to a tier. They are grown in around 107 countries, for example... India, China, Brazil, Phillipines, Indonesia, Ecuador, Costa Rica, Tanzania, Thailand, Mexico, Vietnam, Kenya, Eqypt and Uganda.'),
(551, 579, 'The best season to buy fruit and vegetables is in Summer, in: July, June and August. The fruit  and vegetables that you can buy in these months are: Aubergine\r\nBeetroot\r\nBroad Beans\r\nBroccoli\r\nCarrots\r\nCourgettes \r\nCucumber\r\nFennel\r\nFresh Peas\r\nGarlic\r\nGreen Beans\r\nLettuce and Salad Leaves\r\nNew potatoes\r\nRadishes\r\nRocket\r\nRunner Beans\r\nSalad Onions\r\nSorrel\r\nTomatoes\r\nWatercress\r\nBlueberries\r\nCurrants – black, white and red\r\nElderflowers\r\nGreengages\r\nLoganberries\r\nPlums\r\nRaspberries\r\nStrawberries\r\nTayberries\r\n'),
(553, 580, 'although bananas are grown and eaten much of it ends up as waste which is a big big shame as lots of hard work goes into doing it!'),
(521, 581, 'How do people dispose of left over meat?\r\nHow much good food is thrown away? \r\nWhat is the best way to dispose of left over meat?\r\nIs it safe to put steak down a food disposal pipe?\r\n\r\nThe British throw away about 30-40% of our food. A recent survey found that 61% of people throw away at least one bag of salad a week without even taking off the packaging. Luckily for our investigation, slightly fewer admitted to throwing away meat. -Sophie\r\n\r\nIf meat is cooked, it can be disposed of in a waste disposal unit. Waste disposal units have been in America for many years and they''re now becoming part of some European kitchens. Usually they are fitted under the kitchen sink and catch solid waste before it gets into the drain. When it''s switched on, the waste disposal unit grinds down food waste into a runny pulp which then washes down the drain without blocking it. As it is soft, cooked meat will pass through easily and safely as long as the water is running. However, uncooked meat can be tough enough to wrap itself around the inside of the waste disposal unit and when it''s stuck it will start to decompose and your kitchen will start to smell! -Sophie\r\n\r\nBecause quite a lot of beef is thrown away, this is obviously contributing to waste as a whole in Britain. This is really bad for the environment, which will affect global warming/ climate change. This is NOT very sustainable because the amount of waste and the global warming is going to affect future generations. -Sophie'),
(554, 584, 'Raspberry plants should be fed in early spring by scattering all purpose 10-10-10 fertilizer around them at the rate of 1 pound per 10 feet of row. They must not be allowed to dry out during flowering and fruiting. \r\nIn spring, shorten the canes to 3 feet, forcing the growth into lateral side branches which are trained along support wires. After they produce fruit, the spent canes are cut back to the ground. With ever bearing varieties the second crop is produced on canes which sprout in the spring, these canes shouldn''t be cut back until they produce fruit the following spring. Never cut off the new canes which haven''t produced yet, they will produce the next years crop. Raspberries are easily propagated by tip layering (pin the tip of the cane to the ground, where it will root, then once rooted you may sever the new start from the parent plant), or from sucker growths which spring up around the parent plant. \r\n\r\n(information on nthe growth of rasberries from : http://www.thegardenhelper.com/raspberry.html\r\n'),
(521, 585, 'How do people dispose of left over meat?\r\nHow much good food is thrown away? \r\nWhat is the best way to dispose of left over meat?\r\nIs it safe to put steak down a food disposal pipe?\r\n\r\nThe British throw away about 30-40% of our food. A recent survey found that 61% of people throw away at least one bag of salad a week without even taking off the packaging. Luckily for our investigation, slightly fewer admitted to throwing away meat. -Sophie\r\n\r\nIf meat is cooked, it can be disposed of in a waste disposal unit. Waste disposal units have been in America for many years and they''re now becoming part of some European kitchens. Usually they are fitted under the kitchen sink and catch solid waste before it gets into the drain. When it''s switched on, the waste disposal unit grinds down food waste into a runny pulp which then washes down the drain without blocking it. As it is soft, cooked meat will pass through easily and safely as long as the water is running. However, uncooked meat can be tough enough to wrap itself around the inside of the waste disposal unit and when it''s stuck it will start to decompose and your kitchen will start to smell! -Sophie\r\n\r\nBecause quite a lot of beef is thrown away, this is obviously contributing to waste as a whole in Britain. This is really bad for the environment, which will affect global warming/ climate change. This is NOT very sustainable because the amount of waste and the global warming is going to affect future generations. -Sophie'),
(553, 586, 'Banana skins cannot be recycled unfortunately, they have to be put in the normal bin. Milton Keynes and many other cities have come up with a way that is kind of like recycling food, but putting it in a food caddy. The waste in the food caddy goes on to go in the green bin. This will then lead to them being re-used for another item of food. This process used in MK will lead to the world becoming more sustainable and have a big influence on future generations.'),
(548, 591, 'Bananas are eaten by people all over the world. '),
(559, 593, 'Bananas are distrubuted'),
(559, 594, 'Bananas have to be transported over long distances because they are grown in the tropics. To gain maximum life, bunches are harvested before the fruit is fully mature. The fruit is carefully handled, transported quickly to the seaboard, cooled, and shipped under sophisticated refrigeration. This technology allows storage and transport for 3-4 weeks at 13 degrees celsius.'),
(521, 598, 'UK scientists say that banana waste can be moulded into a type of briquette that can be used for cooking, lighting and heating.\r\n'),
(535, 599, 'Bread flour is grown not reared\r\nNo ingredients in bread have reared as they have been grown into crops to harvest.\r\n'),
(551, 608, 'The best season to buy fruit and vegetables is in Summer, in: July, June and August. The fruit  and vegetables that you can buy in these months are: Aubergine\r\nBeetroot\r\nBroad Beans\r\nBroccoli\r\nCarrots\r\nCourgettes \r\nCucumber\r\nFennel\r\nFresh Peas\r\nGarlic\r\nGreen Beans\r\nLettuce and Salad Leaves\r\nNew potatoes\r\nRadishes\r\nRocket\r\nRunner Beans\r\nSalad Onions\r\nSorrel\r\nTomatoes\r\nWatercress\r\nBlueberries\r\nCurrants – black, white and red\r\nElderflowers\r\nGreengages\r\nLoganberries\r\nPlums\r\nRaspberries\r\nStrawberries\r\nTayberries\r\n'),
(554, 609, 'Raspberry plants should be fed in early spring by scattering all purpose 10-10-10 fertilizer around them at the rate of 1 pound per 10 feet of row. They must not be allowed to dry out during flowering and fruiting. \r\nIn spring, shorten the canes to 3 feet, forcing the growth into lateral side branches which are trained along support wires. After they produce fruit, the spent canes are cut back to the ground. With ever bearing varieties the second crop is produced on canes which sprout in the spring, these canes shouldn''t be cut back until they produce fruit the following spring. Never cut off the new canes which haven''t produced yet, they will produce the next years crop. Raspberries are easily propagated by tip layering (pin the tip of the cane to the ground, where it will root, then once rooted you may sever the new start from the parent plant), or from sucker growths which spring up around the parent plant. \r\n\r\n(information on nthe growth of rasberries from : http://www.thegardenhelper.com/raspberry.html\r\n'),
(570, 610, 'The best time to harvest raspberries is in July '),
(570, 612, 'The best time to harvest raspberries is in July  hi'),
(570, 613, 'The best time to harvest raspberries is in July  '),
(572, 614, 'fruits are eaten all round the year.'),
(579, 621, 'There are many different processes for raspberries, such as Individually Quick Frozen (IQF) This is where certain raspberries are hand picked and chosen to be frozen for later use, they are frozen in a tunnel that is between -5° to -10°. This holds in colours and flavours.\r\nBlock frozen raspberries are frozen in blocks together within their own juices to maintain flavour, this is used a lot now as it preserves fruit. They are normally frozen in 6.5 pound or 4 gallon - 50 gallon tubs.\r\nYou can also get frozen raspberry puree, this is where the raspberries are passed through a number of seives to make them a smooth red puree, with no seeds. These are used in dessert toppings.\r\nYou can also get raspberry concentrate and dehydrated raspberries.\r\nDehydrated raspberries are when they are dried and are good to have as they have a longerproduct life before they begin to rot.\r\n'),
(550, 704, 'Bananas are packages in different ways depending of their quality - we think that the value bananas will have worse quality packaging than the finest quality packaging bacause of the prices. '),
(547, 705, 'Bananas get stored at both home and restaurants. They are mainly kept in dry places, that have a fairly high temperature.'),
(521, 707, 'UK scientists say that banana waste can be moulded into a type of fuel that can be used for cooking, lighting and heating.\r\n'),
