(796, 852, 'We learned a lot about collecting data and thinking about good research questions. We realised that even though we talked about aspect because we felt was important, we didn''t take a compass with us and measure it so we couldn''t really be sure which aspect some of the buildings and data collection points had.  If we were doing this inquiry again we would need to do more planning.\r\n\r\nIf we were going to do this again we''d try to visit each place on several days so we knew we were measuring climate and not just weather on the day.'),
