(891, 1016, 'Welcome to your Microclimates investigation. This is your Year 9 geography fieldwork investigation. We will find out more about local climates, called microclimates, and gather data from around the school. We''ll then analyse our data and draw some conclusions. Microclimates are areas where the normal temperature and conditions are slightly different from the surrounding areas. Most common microclimates are around large buildings such as shops, schools and office blocks.\r\n\r\nTo write up your experiment follow the format and include the information below:\r\n<p>\r\n   1. HYPOTHESIS:\r\n          * Write out your hypothesis as a title for the experiment. This is what you are trying to prove or disprove.\r\n   2. EQUIPMENT:\r\n          * List the equipment you needed to complete the experiment.\r\n          * Download relevant images from the Geography shared area of the equipment used.\r\n   3. METHOD:\r\n          * Write the method (how you carried out the experiment) like a recipe so that someone else could follow your instructions. It must be detailed.\r\n          * Remember:\r\n                o The locations of each temperature reading\r\n                o How you used the digital thermometers to record temperatures around the school site.\r\n                o Include photos of the different areas tested\r\n                o Include relevant photos of the methods\r\n                o Label all photos e.g. This photo shows ...\r\n   4. RESULTS:\r\n          * Produce a table and input the results recorded.\r\n          * Plot the data onto the school base map provided\r\n   5. ANALYSIS:\r\n          * This section is where you must include figures and keywords to describe differences and similarities between the data recorded and give reasons.For example:\r\n               1. Produce a graph (either on the paper provided or using an excel spreadsheet and clicking on the chart wizard button).\r\n                  Key words to include: REFLECTION, HEAT, ABSORBTION, THERMAL, WIND, SHELTER, ASPECT.\r\n               2. To extend link the temperatures to urban and rural areas, reflection and absorption of heat on different surfaces and the concept of urban-heat-islands.\r\n               3. Think about the prevailing wind directions and areas of the school site that are sheltered.\r\n   6. 6. CONCLUSION:\r\n          * Refer back to the hypothesis and state whether from the data collected it can be proved or disproved.\r\n          * What problems did you encounter in the experiment? (do not refer to individuals, think about the equipment, the surfaces etc).\r\n          * What could be done to improve or extend the experiment? (test a surface more times, different times of the year, different places, different vegetation covering etc).\r\n\r\n'),
